package com.bituos.SMS.Beans;

import java.util.Date;


/**
 * @author dsa@bituos.com
*/

public class BeanSms{

	private int id;
	private String number;
	private String msg;
	private Date date_reg;
	private Date date_send;
	private int id_status;
	
	
	
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getNumber() {
		return number;
	}
	public void setNumber(String number) {
		this.number = number;
	}
	public Date getDate_register() {
		return date_reg;
	}
	public void setDate_register(Date date_reg) {
		this.date_reg = date_reg;
	}
	public Date getDate_send() {
		return date_send;
	}
	public void setDate_send(Date date_send) {
		this.date_send = date_send;
	}
	public int getId_status() {
		return id_status;
	}
	public void setId_status(int id_status) {
		this.id_status = id_status;
	}
	public String getMsg() {
		return msg;
	}
	public void setMsg(String msg) {
		this.msg = msg;
	}
	public Date getDate_reg() {
		return date_reg;
	}
	public void setDate_reg(Date date_reg) {
		this.date_reg = date_reg;
	}

	
	





	
	
}
